import React ,{useState, useEffect} from 'react';
import './index.css'
import Icon2 from "../../images/city.jpeg";
import {Button} from '../ButtonElementRedirect';
import Axios from 'axios';
import {useParams} from 'react-router-dom';
import {serverURL} from '../../APIconfig';
import ButtonElementRedirect from './'


function ArtistDetails() {
    const [docs, setDocs] = useState([])
    // Axios.get

    const params = useParams()

    useEffect(() => {
        Axios.get(serverURL+ '/getArtists/' + params.id)
        .then((res) => {
            console.log(res.data[0]);
            setDocs(res.data[0]);
            console.log(docs);
        })
        .catch((err) => console.log(err))    
    }, [])



    return (
        <div class='container'>
            <div class="wrapper">
                <div class="card1">
                    <img src='/images/Avatar.jpeg' alt="Hey" class="image"/>
                </div>
                <div class="card2">
                    <div class="name">{docs.username}</div>
                    <div class="artist"><b>Speciality{docs.speciality}</b></div>
                    <div class="status">Status :{docs.status}</div>
                    <ButtonElementRedirect>Place Commission Order</ButtonElementRedirect>
                </div>
            </div>
        </div>
    )
}

export default ArtistDetails;
